import React from "react";
import ReactDom from "react-dom";
const name = "Pawan Chauhan";
ReactDom.render(
  <>
    <h1 contentEditable="true">{`I am ${name}.I am a God`}</h1>
    <img src="im" />
  </>,
  document.getElementById("root")
);
